(9, 'Alasan kenapa memilih Github Pages sebagai tempat menulis?', 'Alasan-kenapa-memilih-Github-Pages-sebagai-tempat-menulis?', '<p>Bagi seorang programmer maupun seorang Informasi Teknologi tidak asing dengan nama Github. Benar Github adalah instagramnya para Programmer (menurut saya).</p><p>Bagi yang senang menulis atau sekedar mengisi waktu kegabutan atau suka berbagi pengalaman lewat tulisan tentunya sudah tidak asing dengan platform menulis seperti Blogspot, Wordpress, Medium atau Tumbler.Â <span style=\"font-size: 1rem;\">Sebelum saya akhirnya memilih Github Pages sebagai platform menulis saya menggunakan Blogspot, namun tampilan yang terbatas membuat saya kurang nyaman dan beralih ke Wordpress, Wordpress memang mudah digunakan tetapi jika wordpress yang gratis bukan wordpress yang dihosting di server juga terbatas tidak bisa custom template dan plugin.</span></p><p><span style=\"font-size: 1rem;\"><br></span><span style=\"font-size: 1rem;\">Menurut saya tempat yang bagus untuk menulis selain di Github Pages adalah di gitlab dan bitbuket, Karena sama dengannya github atau github pages menulis artikel maupun simpan data pada repository, saya juga biasanya menulis disini tentang artikel-artikel programming.\r\n\r\n\r\nKalau Github Pages ini memang agak sulit digunakan karena memang ditunjukan buat developer yang harus install Jekyll, edit tema, dll, tetapi malah enak karena yang pertama adalah gratis, kedua adalah kontrol penuh terhadap blog pribadi saya malah bisa di custom domainnya.</span></p><p><img src=\"data:image/png;base64,\" style=\"width: 100%;\" data-filename=\"download (3).png\"><span style=\"font-size: 1rem;\"><br></span></p><p>\r\n\r\nPilihannya adalah jika kalau mencari rating atau viewers atau pembaca tulisan maka pilihlah medium, disarankan kalau nulis di medium adalah tulisan yang berbobot biar banyak yang kasih clap, tetapi kalau mau menulis sekedar pengalaman yang biasa atau tulisan-tulisan biasa saya pilih Github Pages aja.</p><p>Kesimpulannya github adalah directory atau hostingnya pada programmer pemula sampai senior, Github pages atau repo pada github bukan bagi seorng programmer saja. Untuk kamu yg bingung mau simpan data atau file saran saya diGithub dijamin deh bakal aman and simpel.</p><p>Mungkin itu aja Penjelasan tentang Githab Pages, Terimakasih sudah mampir.</p>', '630a32df95103.jpg', 'publish', 6, 1, 'alif', '2022-09-02 13:40:00', NULL),
(70, 'Demon Slayer : Inikah Kelemahan Terbesar Kibutsuji Muzan?', 'Demon-Slayer-:-Inikah-Kelemahan-Terbesar-Kibutsuji-Muzan?', '<p>Dalam beberapa tahun terakhir, Demon Slayer telah menjadi nama series paling digemari dalam waralaba anime. Dengan animasi berkualitas tinggi, penceritaan langsung, dan karakter yang dibuat dengan baik, kesuksesan seri ini tentunya tentunya tidak begitu mengejutkan.</p><p>Muzan Kibutsuji adalah salah satu karakter paling kuat di Demon Slayer: Kimetsu no Yaiba . Meski begitu, dia bukannya tanpa kelemahan. Salah satu kelemahan terbesarnya adalah dia&nbsp;tidak bisa terkena sinar matahari. Makanya, dia pun bertekad untuk bisa menyembuhkan kelemahannya itu agar bisa bergerak lebih leluasa.</p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"untitled-design-4-61c12d267a6d8844b864af12 (1).jpg\"><br></p><p>Pilar kunci lain dalam kesuksesan setiap seri anime atau manga adalah penjahat utama yang super kuat, dan penjahat yang menjadi pilar kunci dari seri Demon Slayer: Kimetsu No Yaiba ini adalah Kibutsuji Muzan.</p><p>Sang raja iblis era Taisho, yang telah terbukti saat ini lebih kuat dan belum menjadi tandingan dari Kamado Tanjiro dan Korps Pembunuh iblis lainya<span style=\"font-size: 1rem;\">Sebagai yang pertama dan pelopor dari semua iblis atau penjahat didalam seri Demon Slayer, Kibutsuji Muzan memiliki kekuatan dahsyat dan pengalaman yang berkembang selama berabad-abad.&nbsp;</span></p><p>Berkat kemampuannya yang luar biasa dan menakutkan tersebut, dia bukan hanya pemimpin dari dua belas iblis paling kuat di Kizuki, tetapi secara de facto adalah pemimpin dari semua jenis iblis.&nbsp;<span style=\"font-size: 1rem;\">Sebagai pimpinan semua iblis, bahkan Muzan dapat membuat namanya menjadi tabu, terutama dalam penyebutan nama \"Kibutsuji\" oleh para iblis buatannya.</span></p><p>Di antara segudang teknik menakutkan di Demon Slayer, Kibutsuji Muzan memiliki kemampuan untuk mengutuk iblis yang dia ciptakan.&nbsp;<span style=\"font-size: 1rem;\">Jika iblis yang dia ciptakan mengatakan \"Kibutsuji\" dengan keras, sebuah kutukan akam langsung aktif dan menewaskan mereka.&nbsp;</span></p><p>Hal ini terlihat pada pertarungan iblis Susamaru dengan Nezuko dan Tanjiro, meskipun Susamaru tidak mengucapkan nama Kibutsuji dengan cara yang jahat atau mengejek, kutukan tersebut masih aktif dan membunuhnya dengan seketika.</p><p><br></p>', '630a321f0121b.png', 'publish', 1, 1, 'naila', '2022-09-01 12:42:26', NULL);
