(72, 'Hijab Cosplay Jadi Karakter Anime : Imutnya Kelewatan!!', 'Hijab-Cosplay-Jadi-Karakter-Anime-:-Imutnya-Kelewatan!!', '<p><span style=\"color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\">Seorang gadis berusia 24 tahun asal Malaysia belum lama ini mencuri perhatian setelah dirinya mencoba kebiasaan yang unik, yakni cosplay menjadi karakter <a href=\"https://id.wikipedia.org/wiki/Anime\" target=\"_blank\">A</a></span><a href=\"https://id.wikipedia.org/wiki/Anime\" target=\"_blank\">nime</a><span style=\"color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\">Â dengan menggunakan hijab.Â </span><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\" style=\"font-size: 1rem; color: rgb(51, 51, 51);\">Selain itu, gadis bernama Amalina atau yang kerap disapa <b>Miisa</b> ini merupakan pemainÂ </span><a href=\"https://id.wikipedia.org/wiki/Cosplay\" open=\"\" sans\",=\"\" sans-serif;=\"\" letter-spacing:=\"\" 0px;=\"\" transition:=\"\" all=\"\" 0.3s=\"\" ease-out=\"\" 0s;=\"\" color:=\"\" rgb(230,=\"\" 14,=\"\" 46);=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" font-size:=\"\" 18px;\"=\"\" style=\"background-color: rgb(255, 255, 255); font-size: 1rem;\">Cosplay</a><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\" style=\"font-size: 1rem; color: rgb(51, 51, 51);\">Â berhijab yang mengawali kegiatannya itu sejak empat tahun lalu.</span></p><p><span open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\" style=\"font-size: 1rem; color: rgb(51, 51, 51);\">Berikut beberapa foto cosplay dari Miisa :</span></p><p><img src=\"data:image/webp;base64,\" style=\"width: 100%;\" data-filename=\"301010100_1142048473058790_7720258029474758518_n.webp\"></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"277400100_657209002027094_4620499105437653569_n (2).jpg\"></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"271827754_3099672883625136_1624715735095396782_n.jpg\"><br></p><h4><span style=\"color: rgb(51, 51, 51); font-size: 1rem;\">Kawai banget ga sihðŸ¤­</span></h4><p><span style=\"color: rgb(51, 51, 51); font-size: 1rem;\">Ia juga mengenalkan profesi itu sendirian sebelum akhirnya mengenalkan hal tersebut kepada teman-temannya di sebuah komunitas cosplay.</span></p><table class=\"table table-bordered\"><tbody><tr><td><h5>\"<span style=\"background-color: var(--bs-table-bg); color: rgb(51, 51, 51);\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\">Â <span style=\"font-family: \" comic=\"\" sans=\"\" ms\";\"=\"\">Cosplay adalah hobi di waktu senggang saya. Dulu saya suka nontonÂ </span></span><span style=\"font-family: \" comic=\"\" sans=\"\" ms\";\"=\"\">anime</span><span style=\"background-color: var(--bs-table-bg); color: rgb(51, 51, 51); font-family: \" comic=\"\" sans=\"\" ms\";\"=\"\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\">, lalu saya suka make-up. Saya tertarik melihat orang-orang berpakaian seperti karakter anime</span><span style=\"font-family: Verdana;\">\"Â </span></h5></td></tr></tbody></table><p><iframe frameborder=\"0\" src=\"https://instagram.com/p/CIj174nBgng/embed/\" width=\"612\" height=\"710\" scrolling=\"no\" allowtransparency=\"true\" class=\"note-video-clip\"></iframe><span style=\"color: rgb(51, 51, 51); font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 18px;=\"\" letter-spacing:=\"\" -0.25px;\"=\"\"><br></span><br></p>', '63070a8f7bc6d.jpg', 'publish', 3, 1, 'alif', '2022-09-02 13:39:49', NULL);
INSERT INTO `posts` (`id`, `judul`, `slug`, `text`, `gambar`, `status`, `tag_id`, `category_id`, `create_by`, `created_at`, `deleted_at`) VALUES
(77, 'Kapan Demon Slayer: Kimetsu no Yaiba season 3 Dirilis? Ada Bocoran Sinopsis Lewat Trailer Terbaru', 'Kapan-Demon-Slayer:-Kimetsu-no-Yaiba-season-3-Dirilis?-Ada-Bocoran-Sinopsis-Lewat-Trailer-Terbaru', '<p>Bocoran Cerita Demon Slayer: Kimetsu no Yaiba Season 3!.&nbsp;<span style=\"font-size: 1rem;\">Dalam teaser 30 detik tersebut terdapat dua visual kunci dari cerita yang akan datang. Hal ini juga mengkonfirmasikan bahwa musim baru akan mengadaptasi Swordsmith Village Arc dari manga. Nah, seperti apa fakta Demon Slayer: Kimetsu no Yaiba Season 3 ke depannya? Mari kita lihat bocoran cerita dan jadwal tayangnya.&nbsp;</span></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"images (1).jfif\"><br></p><p><br></p><p>Bocoran Cerita Demon Slayer: Kimetsu no Yaiba Season 3</p><p>Dikutip dari technadu.com, penggemar akan melihat kelanjutan cerita di Swordsmith Village Arc yang berjalan dari bab 98 hingga 127 dalam versi manga. Tanjiro dan teman-temannya akan ditemani oleh Love Hashira Mitsuri Kanoji dan Mist Hashira Muichiro Tokito saat mereka berhadapan dengan Upper-Rank Four And Five.</p><p>Seperti namanya, Desa Swordsmith adalah tempat semua Bilah Nichirin ditempa. Ketika Hotaru menolak untuk memperbaiki pedang Tanjiro untuk ketiga kalinya, Tanjiro memutuskan pergi ke Desa Swordsmith untuk mendapatkan pedang baru.&nbsp;</p><p>Namun, ketika Tanjiro tiba, dia mengetahui bahwa Hatoru telah hilang selama beberapa waktu. Khawatir tetapi tidak yakin apa yang harus dilakukan, Tanjiro menabrak Mitsuri (Love Hashira) dan mengetahui darinya bahwa ada senjata rahasia yang bersembunyi di desa, yang seharusnya membuat penggunanya secara eksponensial lebih kuat. Muichiro Tokito bersikeras menemukan senjata ini, dan Tanjiro ikut serta.</p><p>Tanpa sepengetahuan para pembunuh, semua Iblis Peringkat Atas telah mengalihkan perhatian mereka ke arah Tanjiro. Itu karena Tanjiro sebelumnya berhasil membunuh Enam Atas, yang akhirnya membuat iblis-iblis lain penasaran. Dua dari setan-setan ini (Upper-Rank Four and Five) berhasil menyusup ke desa tanpa terdeteksi dan mulai mengerjakan skema licik mereka untuk menghancurkan sumber kekuatan Demon Slayer Corps sekali dan untuk selamanya.</p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 100%;\" data-filename=\"download (2).jfif\"><br></p><p>Seperti sebelumnya Demon Slayer telah dengan setia mengikuti jadwal premier Musim Gugur (September- November) selama bertahun-tahun sekarang. Anime ini memulai debutnya pada Musim Gugur 2019, film Mugen Train pertama kali ditayangkan pada Musim Gugur 2020, dan rekap musim pada Musim Gugur 2021.</p><p><b>Jika ini adalah indikasi, Arc Swordsmith Village akan tayang perdana pada Musim Gugur 2022, atau setidaknya berhasil mencapai slot musim dingin utama 2023 (Desember 2022 - Januari 2023). Mudah-mudahan, penantiannya tidak lama.</b></p>', '630996bfe6bfb.png', 'publish', 1, 1, 'naila', '2022-09-02 11:46:28', NULL);
